const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');
const inputSlider = document.getElementById('resolution');

const image = new Image();

image.src = 'data:image/jpeg;base64,'

inputSlider.addEventListener('change', () => {
    console.log(inputSlider.value);
    initialize(parseInt(inputSlider.value));
})

class Cell {
    constructor(x,y,symbol,color){
        this.x = x;
        this.y = y;
        this.symbol = symbol;
        this.color = color;
    }

    draw(ctx){
        ctx.fillStyle = this.color;
        ctx.fillText(this.symbol, this.x, this.y)
    }
}

class AsciiEffect {
    #imageCellArray = [];
    #pixels = [];
    #ctx = [];
    #width;
    #height;

    constructor(ctx,width, height){
        this.#ctx = ctx;
        this.#width = width;
        this.#height= height;
        this.#ctx.drawImage(image, 0,0, this.#width, this.#height);
        this.#pixels = this.#ctx.getImageData(0,0,this.#width, this.#height);
    }

    
    #converToSymbol(averageColorValue){
        if (averageColorValue > 250)
        return '@';
    else if (averageColorValue > 240)
        return '';
    else if (averageColorValue > 230)
        return '';
    else if (averageColorValue > 220)
        return '';
    else if (averageColorValue > 210)
        return '';
    else if (averageColorValue > 200)
        return '';
    else if (averageColorValue > 190)
        return '';
    else if (averageColorValue > 180)
        return '';
    else if (averageColorValue > 170)
        return '';
    else if (averageColorValue > 160)
        return '';
    else if (averageColorValue > 150)
        return '';
    else if (averageColorValue > 140)
        return '';
    else if (averageColorValue > 130)
        return '';
    else if (averageColorValue > 120)
        return '';
    else if (averageColorValue > 110)
        return '';
    else if (averageColorValue > 100)
        return '';
    else if (averageColorValue > 90)
        return '';
    else if (averageColorValue > 80)
        return '';
    else if (averageColorValue > 70)
        return '';
    else if (averageColorValue > 60)
        return '';
    else if (averageColorValue > 50)
        return '.';
    else
        return ' ';
    }

    #scanImage(cellSize){
        this.#imageCellArray = [];
        for(let y = 0; y < this.#pixels.height; y += cellSize){
            for(let x = 0; x < this.#pixels.width; x += cellSize){
                const posX = x * 4;
                const posY = y * 4;
                const pos  = (posY * this.#pixels.width) + posX; 

                if(this.#pixels.data[pos + 3] > 128){
                    const red = this.#pixels.data[pos];
                    const green = this.#pixels.data[pos+1];
                    const blue = this.#pixels.data[pos+2];
                    const total = red + green + blue;
                    const averageColorVaue = total/3;
                    const color = "rgb(" + 255 + "," + 255 + "," + 255 + ")";
                    const symbol = this.#converToSymbol(averageColorVaue);
                    this.#imageCellArray.push(new Cell(x,y,symbol, color));
                }
            }
        }
        console.log(this.#imageCellArray);
    }

    #drawAscii(){
        this.#ctx.clearRect(0,0,this.#width, this.#height)
        for(let i = 0; i < this.#imageCellArray.length; i++){
            this.#imageCellArray[i].draw(this.#ctx);
        }
    }
    
    draw(cellSize){
        this.#scanImage(cellSize)
        this.#drawAscii();
    }
}

let effect;

image.onload = initialize(2);



function initialize(test) {
    canvas.width = image.width;
    canvas.height = image.height;
    effect = new AsciiEffect(ctx,image.width,image.height);
    effect.draw(test);
}
